import React from 'react';
// eslint-disable-next-line
import ReactDOM from 'react-dom';
import AppHeader from './components/app-header'
import ToDoList from './components/todo-list'
import SearchPanel from './components/search-panel'

const App = () => {
    const todoData = [{ //сдесь мы создаем данные, которые будут
        // использоваться в качестве props, смотри ToDoList
        label: 'Kiss Mila',
        important: true,
        id:1
    },
    {
        label: 'Make awesome App',
        important: true,
    },
    {
        label: 'Drink coffee',
        important: false,

    }
    ]
    //const isLogged = true;
    //const loginBox = <span> Login please </span>;
    //const welcomeBox = <span> Welcome Back</span>
    // {isLogged ? welcomeBox :loginBox} должно быть в return

    return (<div>

        <AppHeader />
        <SearchPanel />
        <ToDoList todos={todoData} /> 
    </div>)// сдесь мы указываем источник для свойства todos
}; //elements


//const el = React.createElement('h1', null, 'Hello World!!!') JS-syntax, after Babel
ReactDOM.render(<App />, document.getElementById('root'))
